<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>LFR RADIO LINK</title>
    <link href="https://fonts.googleapis.com/css2?family=VT323&display=swap" rel="stylesheet">
    <style>
        :root {
            --color-bg-start: #041704;
            --color-bg-end: #0f3516;
            --color-text: #00ff00;
            --color-crt-glow: #0aff0a;
            --color-button: #032503;
            --color-button-hover: #0a3a0a;
            --color-divider: #010a01;
            --scanline-opacity: 0.2;
            --flicker-animation-duration: 0.1s;
        }

        /* Base styles and CRT font */
        body, html {
            height: 100%;
            margin: 0;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            font-family: 'VT323', monospace;
            background: linear-gradient(180deg, var(--color-bg-start) 0%, var(--color-bg-end) 100%);
            color: var(--color-text);
            overflow-x: hidden;
            user-select: none;
            cursor: url('data:image/svg+xml;utf8,<svg xmlns="http://www.w3.org/2000/svg" width="16" height="16"><rect width="16" height="16" fill="%230aff0a" opacity="0.5"/></svg>') 8 8, default;
        }

        /* Container for field radio panel look */
        .radio-panel {
            width: 95%;
            max-width: 500px;
            min-height: 90vh;
            border: 4px solid #000000;
            box-shadow: 0 0 10px rgba(0, 0, 0, 0.8), inset 0 0 10px rgba(0, 0, 0, 0.5);
            background-color: #031503;
            padding: 15px;
            display: flex;
            flex-direction: column;
            gap: 10px;
            position: relative;
        }

        /* Top Bar */
        .top-bar {
            display: flex;
            justify-content: space-between;
            align-items: center;
            text-shadow: 0 0 5px var(--color-crt-glow);
            margin-bottom: 5px;
        }
        .logo {
            font-size: 1.5rem;
            font-weight: bold;
            letter-spacing: 2px;
        }
        .status-indicator {
            padding: 3px 8px;
            border: 1px solid var(--color-text);
            background-color: #010f01;
            box-shadow: 0 0 5px var(--color-crt-glow);
            animation: pulse-glow 2s infinite alternate;
        }

        /* CRT Display */
        .crt-display-wrapper {
            background-color: black;
            border: 3px inset #010a01;
            padding: 10px;
            box-shadow: 0 0 10px rgba(0, 255, 0, 0.4), inset 0 0 15px rgba(0, 255, 0, 0.2);
            position: relative;
            min-height: 150px;
            display: flex;
            flex-direction: column;
            justify-content: center;
            overflow: hidden;
        }
        .crt-display {
            line-height: 1.2;
            text-align: left;
            white-space: pre-wrap;
            word-wrap: break-word;
            text-shadow: 0 0 5px var(--color-crt-glow);
            animation: crt-flicker var(--flicker-animation-duration) infinite alternate;
            z-index: 2;
        }
        .crt-channel-num {
            font-size: 2.5rem;
            margin-bottom: 5px;
            color: var(--color-crt-glow);
        }
        .crt-label {
            font-size: 1.5rem;
            margin-bottom: 5px;
        }
        .crt-description {
            font-size: 1rem;
            color: #00aa00;
        }

        /* CRT Effects */
        .scanlines {
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: linear-gradient(to bottom, transparent 50%, rgba(0, 0, 0, var(--scanline-opacity)) 50%);
            background-size: 100% 4px;
            z-index: 3;
            pointer-events: none;
        }
        .flimmer-overlay {
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background-color: transparent;
            z-index: 4;
            pointer-events: none;
            animation: flimmer 4s linear infinite;
        }

        /* Ridge/Divider */
        .divider {
            height: 5px;
            background-color: var(--color-divider);
            border-top: 1px solid #000000;
            border-bottom: 1px solid #000000;
            box-shadow: inset 0 1px 3px #000000, 0 1px 2px #111111;
            margin: 10px 0;
        }

        /* Channel Buttons */
        .channel-list {
            display: flex;
            flex-direction: column;
            gap: 8px;
            flex-grow: 1;
        }
        .channel-button {
            background-color: var(--color-button);
            border: 2px solid #000000;
            color: var(--color-text);
            padding: 10px;
            text-align: left;
            text-decoration: none;
            font-size: 1.4rem;
            cursor: pointer;
            transition: background-color 0.1s, box-shadow 0.1s;
            display: flex;
            align-items: center;
            justify-content: space-between;
            box-shadow: inset 0 0 5px #000000, 2px 2px 5px #000000;
        }
        .channel-button:hover {
            background-color: var(--color-button-hover);
            box-shadow: inset 0 0 8px var(--color-crt-glow), 0 0 5px var(--color-crt-glow);
            text-shadow: 0 0 5px var(--color-crt-glow);
        }
        .channel-button:active {
            background-color: var(--color-text);
            color: #000000;
            box-shadow: inset 0 0 5px #000000;
            transform: translateY(1px);
        }

        /* Knob Icon - simple representation */
        .knob {
            width: 15px;
            height: 15px;
            background-color: #1a1a1a;
            border-radius: 50%;
            border: 2px solid #000000;
            position: relative;
            box-shadow: inset 0 0 3px #333333;
        }
        .knob::after {
            content: '';
            position: absolute;
            top: 50%;
            left: 50%;
            width: 3px;
            height: 5px;
            background-color: var(--color-text);
            transform: translate(-50%, -50%) rotate(45deg);
        }
        .channel-button:hover .knob {
            border-color: var(--color-crt-glow);
        }
